USE [Ophelia]
CREATE TABLE [dbo].[Clients]
(
	[Id] [int] IDENTITY(1,1) NOT NULL primary key ,
	[CName] [varchar](50) NOT NULL,
	[DocType] [varchar](3) NOT NULL,
	[DocNumber] [varchar](20) NOT NULL,
	[BirthDate] [datetime] NOT NULL,
	[Phone] [varchar](20) NULL	
)
GO
CREATE TABLE [dbo].[Company](
	[Id] [int] IDENTITY(1,1) NOT NULL primary key,
	[CoName] [varchar](30) NOT NULL,
	[Email] [varchar](30) NOT NULL,
	[Nit] [varchar](20) NOT NULL,
	[Phone] [varchar](20) NULL,
	
)
GO
CREATE TABLE [dbo].[Product](
	[Id] [int] IDENTITY(1,1) NOT NULL primary key,
	[PName] [varchar](50) NOT NULL,
	[Price] [money] NOT NULL,
	[Stock] [int] NOT NULL
)
go
CREATE TABLE [dbo].[Bill](
	[Id] [int] IDENTITY(1,1) NOT NULL PRIMARY KEY,
	IdClient INT REFERENCES Clients (Id) NOT NULL,
	IdCompany INT REFERENCES Company (Id) NOT NULL,
	[PurchaseDate] [datetime] NOT NULL,
	[Total] [money] NOT NULL,
	[Step] [char](1) NOT NULL
	)
GO
CREATE TABLE [dbo].[BillDetail](
	[Id] [int] IDENTITY(1,1) NOT NULL PRIMARY KEY,
	IdProduct INT REFERENCES Product (id) NOT NULL,
	IdBill INT REFERENCES Bill (id) NOT NULL,
	[Qty] [int] NOT NULL,
	[Total] [money] NOT NULL
	)
GO
